description:
Односекционный настенный шкаф REXANT 9U поставляется в разобранном виде. Дверца оснащена замком, может быть установлена для открытия как в левую, так и правую сторону (радиус открытия 220º).
Съемные боковые стенки укомплектованы защелками, что обеспечивает легкий и удобный доступ к установленному оборудованию. 
На задней стенке расположены отверстия для крепления шкафа к стене. Крышка оборудована съемными панелями для установки вентиляторного модуля и оснащена технологическими отверстиями для двух кабельных вводов. 
Каркас изготовлен из листовой стали 1,5 мм, дверь – из металла толщиной 1,25 мм.
Предусмотрены заземляющие соединения.
Для монтажа 19" оборудования используется пара вертикальных металлических профилей, имеющих разметку в юнитах (U). Покрытие – порошковая окраска с предварительным фосфатированием.
В комплекте поставляются 2 уголка для поддержки оборудования.

Конструктивные характеристики:
Поставляются в разобранном виде, в удобном для транспортировки гофрокартонном ящике - (1 место);
Полезная ширина шкафа - 570 мм;
Полезная глубина шкафа - 600 мм;
Полезная высота шкафа - 500 мм;
Цвет стандарта Ral7035;
Максимальная нагрузка до 90 кг;
Степень защиты IP20;
Радиус открытия двери 220º;
Каркас изготовлен из листовой стали толщиной 1,5 мм;
Передняя дверь металлическая 1,25 мм оснащена замком;
Дверца может быть установлена для открытия в левую и правую сторону;
Боковые панели съемные на защелках;
Одна пара вертикальных 19” направляющих;
Крышка оборудована съемными панелями для установки вентиляторного модуля;
Дно и крышка оборудованы съемными панелями для ввода кабелей.

